import React, { Children, useEffect } from "react";
import { Navigate } from "react-router-dom";

const PrivateRoutes = (probs) => {
  console.log(probs);
  if (probs.isLogin) {
    return <Navigate to="/" />;
  }
  console.log(Children);
  return <>{probs.Children}</>;
};

export default PrivateRoutes;
